// -------------------- Import --------------------
import React, { Component } from "react";
import { NavLink } from "react-router-dom";

// -------------------- Main Bar --------------------
export default class MainBar extends Component {
  render() {
    return (
      <header className="main_bar">
        {/* Logo */}
        <div>LOGO</div>
        {/* Title */}
        <h1>NBA</h1>
        {/* Players */}
        <NavLink to="/Players">
          <button>Players</button>
        </NavLink>
        {/* Teams */}
        <NavLink to="/Teams">
          <button>Teams</button>
        </NavLink>
      </header>
    );
  }
}
